import React from 'react';

const TeacherDashboard = () => {
  return (
    <div style={styles.container}>
      <h1>Teacher Dashboard</h1>
      <p>Manage your services and schedules here.</p>
    </div>
  );
};

const styles = {
  container: {
    padding: '20px',
    textAlign: 'center',
  },
};

export default TeacherDashboard;
